WOMT_aTexte['popup_faq_1_frage']=new Array();
WOMT_aTexte['popup_faq_1_frage'][0]='Nach welchen Kriterien werden die Parteien f√ºr den Wahl-O-Mat ausgesucht?';
WOMT_aTexte['popup_faq_1_frage'][1]='¬†';
WOMT_aTexte['popup_faq_1_text']=new Array();
WOMT_aTexte['popup_faq_1_text'][0]='Die bpb hat alle Parteien und politischen Vereinigungen, die vom Bundeswahlleiter bzw. den Landeswahlleitern zur Bundestagswahl zugelassen wurden, zur Teilnahme am Wahl-O-Mat eingeladen. Eine informative √úbersicht aller zugelassenen Parteien finden Sie auf <a tabindex="16" title="Wer steht zur Wahl? (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.werstehtzurwahl.de" target="_blank">www.werstehtzurwahl.de</a>. Von den 27 zugelassenen Parteien haben 24 die Thesen bis Redaktionsschluss am 14. August 2009 beantwortet. Diese Parteien und politischen Vereinigungen konnten somit in den Wahl-O-Mat aufgenommen werden. Grunds√§tzlich gilt als Kriterium, dass alle Parteien und politischen Vereinigungen am Wahl-O-Mat teilnehmen d√ºrfen, die in mindestens einem Bundesland mit Landesliste zur Wahl zugelassen werden. Es werden also keine Einzelkandidaten und sonstige politischen Vereinigungen aufgenommen, die nur in einem oder wenigen Wahlkreisen antreten. Somit k√∂nnen aber auch Parteien im Wahl-O-Mat auftauchen, die vom Verfassungsschutz des Bundes oder der L√§nder beobachten werden und als "extremistisch" eingestuft werden. Welche Parteien als extremistisch eingestuft werden, k√∂nnen Sie auf den Seiten des Verfassungsschutzes nachlesen: <a tabindex="17" title="www.verfassungsschutz.de (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.verfassungsschutz.de" target="_blank">www.verfassungsschutz.de</a>. Zus√§tzlich kommt die bpb dem Informationsbed√ºrfnis √ºber alle zur Wahl zugelassenen Parteien und W√§hlervereinigungen auch weiterhin durch das Online-Angebot <a tabindex="18" title="Wer steht zur Wahl? (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.werstehtzurwahl.de" target="_blank">"Wer steht zur Wahl?"</a> nach.';
