WOMT_aTexte['popup_faq_9_text']=new Array();
WOMT_aTexte['popup_faq_9_text'][0]='Die Beschr√§nkung auf acht Parteien dient vor allem der √úbersicht und Vergleichbarkeit. Eine Auswertung von mehr als acht Parteien gleichzeitig kann im Wahl-O-Mat nicht mehr sinnvoll und f√ºr den Nutzer nachvollziehbar dargestellt werden. Allerdings kann man nach der ersten Auswertung auf "zur√ºck zur Parteienauswahl" klicken. Jetzt kann man sich f√ºr eine andere Auswahl von maximal acht Parteien entscheiden und sich ein neues Ergebnis errechnen lassen. Daf√ºr m√ºssen nicht alle Thesen neu beantwortet werden. <br/>Zudem bieten wir Ihnen auf der Ergebnisseite des Wahl-O-Mat ein PDF zum Download an, in dem alle Antworten der Parteien und sonstigen politischen Vereinigungen auf die Wahl-O-Mat-Thesen zusammengefasst sind.';
