WOMT_aTexte['popup_faq_2_frage']=new Array();
WOMT_aTexte['popup_faq_2_frage'][0]='Wie ist der Wahl-O-Mat entwickelt worden? Sind die Parteien und W√§hlervereinigungen daran beteiligt gewesen?';
WOMT_aTexte['popup_faq_2_frage'][1]='&nbsp;';
WOMT_aTexte['popup_faq_2_text']=new Array();
WOMT_aTexte['popup_faq_2_text'][0]='Der Wahl-O-Mat ist f√ºr die Bundesrepublik Deutschland erstmals zur Bundestagswahl 2002 eingesetzt worden. Er wurde von einer unabh√§ngigen Redaktion, die aus jungen Erwachsenen besteht, in Kooperation mit der Bundeszentrale f√ºr politische Bildung/bpb und mit Unterst√ºtzung ihrer Partner und des niederl√§ndischen Instituut voor Publiek en Politiek (Institut f√ºr √ñffentlichkeit und Politik - IPP) entwickelt. Dabei ging der Wahl-O-Mat aus dem StemWijzer hervor. Das ist ein vom IPP entwickelter Test, mit dem Sie feststellen k√∂nnen, wie Sie pers√∂nlich zu den Zielen und Positionen von Parteien stehen. Dieser Test geh√∂rt in den Niederlanden seit langem fest zum Vorwahlgeschehen. Bei der Bundestagswahl 2002 wurde der Wahl-O-Mat √ºber 3,6 Millionen mal gespielt. Seitdem wurde er von der bpb bei √ºber zehn Landtagswahlen, sowie den Europawahlen 2004 und 2009 eingesetzt. Zur Bundestagswahl 2005 wurde der Wahl-O-Mat √ºber 5,1 Millionen und zur Europawahl 2009 mehr als 1,5 Millionen mal gespielt. <br/><br/>Die Redaktion des Wahl-O-Mat f√ºr die Bundestagswahl 2009 bestand aus insgesamt 21 jungen Menschen aus ganz Deutschland, unterst√ºtzt von Wissenschaftlern und Experten sowie der bpb. In zwei Workshops hat die Redaktion die Thesen des Wahl-O-Mat entwickelt und formuliert. Den Parteien und sonstigen politischen Vereinigungen wurde eine Liste mit insgesamt 87 Thesen zugeschickt. Sie wurden gebeten, die Thesen entsprechend der Parteihaltung mit "stimme zu", "stimme nicht zu" oder "neutral" zu beantworten. Aus den ausgef√ºllten Listen wurden diejenigen Thesen rechnerisch ermittelt, die keine ausreichende Unterscheidung der Parteien und W√§hlervereinigungen m√∂glich machten, und entfernt. Die Redaktion hat aus den verbleibenden eine endg√ºltige Auswahl von 38 Thesen getroffen, die in den Wahl-O-Mat eingebunden wurden. Die Parteien und W√§hlervereinigungen waren an der Endauswahl der Thesen nicht beteiligt. Mehr zum Entstehungsprozess eines Wahl-O-Mat finden Sie in unserem <a tabindex="24" title="Making of (Dieser Link √∂ffnet sich in einem neuen Fenster.)" target="_blank" class="link_normal" href="http://www.bpb.de/methodik/N7OHM4,0,0,Making_of_WahlOMat.html">"Making of"</a>.';
WOMT_aTexte['popup_faq_2_text'][1]='¬†';
WOMT_aTexte['popup_faq_3_frage']=new Array();
WOMT_aTexte['popup_faq_3_frage'][0]='Wieso kommen manche wichtige Themen im Wahl-O-Mat nicht zur Sprache? ';
WOMT_aTexte['popup_faq_3_frage'][1]='&nbsp;';
WOMT_aTexte['popup_faq_3_text']=new Array();
WOMT_aTexte['popup_faq_3_text'][0]='Das ist eine schwierige Frage. Wer entscheidet, welche Themen wichtig sind und welche nicht? Die Regierung, die Parteien, die Medien und die B√ºrgerinnen und B√ºrger haben dazu sehr unterschiedliche Meinungen. Bei der Auswahl der Thesen f√ºr unseren Wahl-O-Mat bezogen wir uns vor allem auf jene Themen, zu denen die Parteien und W√§hlervereinigungen unterschiedliche Meinungen haben und auf jene, die besonders auch f√ºr junge Leute von Interesse sind. Leider sind w√§hrend des Entstehungsprozesses auch "gute" Thesen aus dem Wahl-O-Mat gefallen. Dies kam vor, weil Thesen von einzelnen Parteien gar nicht oder nicht eindeutig mit stimme zu / stimme nicht zu / neutral beantwortet wurden oder weil die Parteipositionen in dieser These keine Unterscheidung zwischen den Parteien und W√§hlervereinigungen erm√∂glichten. Wir haben Interesse an Ihrer Meinung. Schicken Sie uns Ihre √úberlegungen zu, am besten unter: <a tabindex="26" title="" class="link_normal" href="mailto:info@wahl-o-mat.de">info@wahl-o-mat.de</a>';
WOMT_aTexte['popup_faq_3_text'][1]='¬†';
WOMT_aTexte['popup_faq_5_frage']=new Array();
WOMT_aTexte['popup_faq_5_frage'][0]='Was mache ich, wenn ich zu einem Thema nichts angeben m√∂chte?';
WOMT_aTexte['popup_faq_5_frage'][1]=' ';
WOMT_aTexte['popup_faq_5_text']=new Array();
WOMT_aTexte['popup_faq_5_text'][0]='Dann enthalten Sie sich Ihrer Stimme und klicken auf "These √ºberspringen". Diese Aussage wird dann beim Ergebnis nicht ber√ºcksichtigt. Letzteres sollten Sie aber nicht zu oft machen, denn wenn zu oft "√ºberspringen" geklickt wird, kann auch kein zuverl√§ssiges Ergebnis errechnet werden. Sie haben jedoch auch die M√∂glichkeit, jederzeit wieder zu einer These zur√ºckzukehren, um sie doch noch zu beantworten.';
WOMT_aTexte['popup_faq_5_text'][1]=' ';
WOMT_aTexte['popup_faq_6_frage']=new Array();
WOMT_aTexte['popup_faq_6_frage'][0]='Wie ist es m√∂glich, dass ich als Ergebnis die Partei erhalte, die ich √ºberhaupt nicht erwartet habe?';
WOMT_aTexte['popup_faq_6_frage'][1]=' ';
WOMT_aTexte['popup_faq_6_text']=new Array();
WOMT_aTexte['popup_faq_6_text'][0]='Ja, das wissen wir nat√ºrlich auch nicht. Bitte erwarten Sie von uns kein Urteil dar√ºber, was eine "gute" oder eine "schlechte" Partei oder W√§hlervereinigung ist. Es ist jedoch bekannt, dass der Wahl-O-Mat manchmal √ºberraschende Ergebnisse aufweist. Das von Ihnen ermittelte Wahl-O-Mat Ergebnis ist eben ein Durchschnittsergebnis aus vielen Themengebieten. Es kann also sein, dass Sie bei einem Themengebiet die Meinung der Partei oder W√§hlervereinigung, der Sie bisher am nahesten standen, treffen, aber im Wahl-O-Mat Gesamtergebnis noch besser mit einer anderen Partei oder W√§hlervereinigung √ºbereinstimmen. Ber√ºcksichtigt werden muss au√üerdem, dass sich das Ergebnis des Wahl-O-Mat eben nur auf die bereitgestellte Thesenauswahl bezieht. Sicher gibt es auch weitere gute Gr√ºnde, sich der einen oder anderen Partei oder W√§hlervereinigung nahe zu f√ºhlen. Wir finden, dass dies eine gute Gelegenheit ist, sich mit den eigenen politischen Positionen und denen der Parteien und W√§hlervereinigungen auseinander zu setzen. Schauen Sie doch einfach mal auf die Webseiten der Parteien.';
WOMT_aTexte['popup_faq_6_text'][1]=' ';
WOMT_aTexte['popup_faq_7_frage']=new Array();
WOMT_aTexte['popup_faq_7_frage'][0]='Warum kann es vorkommen, dass bei mir √úbereinstimmungen mit einer vom Verfassungsschutz als extremistisch eingestuften Partei angezeigt werden?';
WOMT_aTexte['popup_faq_7_frage'][1]=' ';
WOMT_aTexte['popup_faq_8_frage']=new Array();
WOMT_aTexte['popup_faq_8_frage'][0]='Ich m√∂chte mehr erfahren als nur das Endergebnis. Wie kann ich die Einstellungen der verschiedenen Parteien zu einzelnen Thesen erfahren und vergleichen?';
WOMT_aTexte['popup_faq_8_frage'][1]=' ';
WOMT_aTexte['popup_faq_8_text']=new Array();
WOMT_aTexte['popup_faq_8_text'][0]='Auf dem Ergebnisbildschirm sehen Sie direkt, wie jede der von Ihnen ausgew√§hlten Parteien oder W√§hlervereinigungen zu jeder These gestimmt hat ("stimme zu"= gr√ºnes H√§kchen, "stimme nicht zu"= rotes Kreuz, "neutral"= graues Minuszeichen). Ein Klick auf das entsprechende Icon zeigt eine kurze Begr√ºndung der Partei bzw. W√§hlervereinigung f√ºr ihre Position an, sofern eine Begr√ºndung abgeben wurde. Wenn Sie auf dem Ergebnisbildschirm das Logo einer Partei bzw. W√§hlervereinigung anklicken, k√∂nnen Sie auf der dann folgenden Seite Ihre eigenen Stellungnahmen zu jeder These mit denen der Partei bzw. W√§hlervereinigung im Detail vergleichen. Auch dort finden Sie unter dem Icon "P" (= Position der Partei) kurze Begr√ºndungen der Partei bzw. W√§hlervereinigung f√ºr deren Positionierung.';
