WOMT_aTexte['popup_impressum_text_datenschutz'][0]='<h1 class="orange">Datenschutzerkl√§rung</h1><div class="text_normal">Wir, die Bundeszentrale f√ºr politische Bildung/bpb als Lizenzgeber des Wahl-O-Mat und Inhaber der Domain www.wahl-o-mat.de, nehmen den Schutz Ihrer pers√∂nlichen Daten und Ihr Recht auf informationelle Selbstbestimmung sehr ernst und halten uns selbstverst√§ndlich an die datenschutzrechtlichen Regeln. Als √∂ffentlich-rechtliche Stelle des Bundes unterliegen wir den Bestimmungen des Bundesdatenschutzgesetzes, dessen Zweck der Schutz vor Beeintr√§chtigungen des Pers√∂nlichkeitsrechts durch den Umgang mit personenbezogenen Daten ist.<br/><br/>Die Bundeszentrale f√ºr politische Bildung/bpb hat technische und organisatorische Ma√ünahmen getroffen, die sicherstellen, dass die Vorschriften √ºber den Datenschutz sowohl von uns als auch von externen Dienstleistern beachtet werden.<br/><br/><b>Zugriff auf die Seiten von wahl-o-mat.de</b><br/>Jeder Zugriff auf unsere Homepage und jeder Abruf einer auf der Homepage hinterlegten Datei werden protokolliert. Die Speicherung dient internen systembezogenen und statistischen Zwecken. Protokolliert werden: Name der abgerufenen Datei, Datum und Uhrzeit des Abrufs, √ºbertragene Datenmenge, Meldung √ºber erfolgreichen Abruf, Webbrowser und anfragende Domain. Die IP Adressen der anfragenden Rechner werden anonymisiert protokolliert, eine R√ºckverfolgung ist nicht m√∂glich. Die Logfiles selbst werden maximal vier Wochen gespeichert, sie werden monatlich automatisch gel√∂scht.<br/><br/>Die bpb nimmt am Z√§hlverfahren der Firma Infonline teil. Dazu sind in die einzelnen Seiten so genannte Z√§hlpixel, kleine transparente Bilder, eingebaut, deren Abruf von der Firma Infonline gez√§hlt wird. Dabei werden keinerlei Informationen √ºber die Benutzer gesammelt, so werden auch keine IP-Adressen gespeichert. Die Daten werden ausschlie√ülich in aggregierter Form auf den Seiten von Infonline gespeichert.<br/><br/><b>Personenbezogene Daten</b><br/>Personenbezogene Daten sind Informationen zu Ihrer Person, die dazu genutzt werden k√∂nnen, Ihre Identit√§t zu erfahren - etwa Ihren richtigen Namen, Ihre Adresse, Postanschrift oder Telefonnummer. Informationen, die keine R√ºckschl√ºsse auf eine bestimmte oder bestimmbare Person zulassen, fallen nicht darunter.<br/><br/>Bei der Nutzung des Wahl-O-Mat werden keinerlei personenbezogene Daten erhoben. Nur, wenn Sie den Wahl-O-Mat per Mailformular weiterempfehlen m√∂chten, werden Sie aufgefordert, eine g√ºltige E-Mail-Adresse als Absender einzugeben. Ihr Wahl-O-Mat-Ergebnis wird dabei von uns nicht gespeichert. Mailtext und Absender-Adresse werden von uns nach erfolgreichem Versenden der Mail weder weiter verarbeitet noch gespeichert. Einzig die Mailadresse des Empf√§ngers wird in einem Mail-Serverlog protokolliert, das nach maximal f√ºnf Wochen gel√∂scht wird.<br/><br/>Die Erhebung, Verarbeitung und Nutzung dieser personenbezogenen Daten - der g√ºltigen Mail-Adresse als Absender - auf www.wahl-o-mat.de unterliegen also Ihrer Zustimmung, und diese Daten werden nicht gespeichert. Wir erheben sie nur im technisch notwendigen Umfang, um die damit verbundene Funktion der Webseite auszuf√ºhren. In keinem Fall werden die erhobenen Daten verkauft oder aus anderen Gr√ºnden an Dritte weitergegeben. Sie werden nur zur unmittelbaren Erf√ºllung des Zweckes verwendet, f√ºr die wir die Daten ben√∂tigen, und sind auch nur den Personen zug√§nglich, die unmittelbar zur Erf√ºllung dieses Zweckes Zugriff auf sie haben m√ºssen.<br/><br/>Soweit Fremdfirmen im Auftrag der Bundeszentrale f√ºr politische Bildung t√§tig werden - etwa, um den Server der Webseite zu pflegen -, werden diese Firmen ausdr√ºcklich darauf verpflichtet, die Daten ausschlie√ülich im Rahmen dieser Zweckbestimmung zu verwenden und anschlie√üend - nach Ablauf eventuell bestehender gesetzlicher Fristen - zu l√∂schen.<br/><br/><b>Cookies</b><br/>Der Wahl-O-Mat verwendet insgesamt zwei so genannte Cookies. Sie dienen dazu, sicherzustellen, dass ein und derselbe Nutzer nicht mehrmals in unserer Nutzungsstatistik gez√§hlt wird. Cookies sind kleine Textdateien, die auf Ihrem Rechner abgelegt werden und die Ihr Browser speichert. Cookies richten auf Ihrem Rechner keinen Schaden an und enthalten keine Viren. Der Wahl-O-Mat funktioniert auch ohne Cookies.<br/><br/><b>Umfrage</b><br/>Am Ende des Wahl-O-Mat wird einer zuf√§lligen Auswahl von Nutzerinnen und Nutzern die M√∂glichkeit angeboten, an einer wissenschaftlichen Evaluation des Wahl-O-Mat teilzunehmen. Die Teilnahme ist freiwillig, die Umfrage ist anonym, d.h. bei ihr werden ebenfalls keine personenbezogenen Daten erfasst. Um Ihr Wahl-O-Mat Ergebnis mit Ihren Antworten im Fragebogen zu korrelieren, wird die Webadresse ihres Wahl-O-Mat-Ergebnisses (Query Session-ID) mit den Antworten im Fragebogen verkn√ºpft. Ihre IP-Adresse wird hierbei jedoch nicht gespeichert. Auf der Seite <a tabindex="100" title="Universit√§t Siegen (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.uni-siegen.de/wahlomat" target="_blank">http://www.uni-siegen.de/wahlomat</a> k√∂nnen Sie die Ergebnisse der Evaluationen einsehen.<br/><br/><b>Kooperationspartner</b><br/>Diese Datenschutzerkl√§rung gilt nur f√ºr den Server von www.wahl-o-mat.de. Der Wahl-O-Mat wird jedoch auch von Kooperations- und Medienpartnern der bpb auf deren eigenen Servern betrieben. Auf diesen kann es andere Datenschutzrichtlinien geben. Die bpb √ºbernimmt keine Verantwortung f√ºr die Datenschutzrichtlinien dieser externen Webseiten.<br/><br/>Kooperations-/Medienpartner der bpb stellen der bpb lediglich t√§glich die Zahl der insgesamt erfolgten Nutzungen des Wahl-O-Mat auf deren Servern zu, die in die Nutzungsstatistik auf www.wahl-o-mat.de eingehen.<br/><br/><b>Auskunftsrecht</b><br/>Sie haben jederzeit das Recht auf Auskunft √ºber die bez√ºglich Ihrer Person gespeicherten Daten, deren Herkunft und Empf√§nger sowie den Zweck der Speicherung. Auskunft √ºber die gespeicherten Daten gibt die Datenschutzbeauftragte der Bundeszentrale f√ºr politische Bildung: <a title="" class="link_normal" href="mailto:diehl@bpb.de" tabindex="101">diehl@bpb.de</a>.<br/><br/><b>Fragen und Kommentare</b><br/>Wenn Sie Fragen haben, die diese Datenschutzerkl√§rung nicht beantworten konnte, wenn Sie zu einem Punkt weitere Informationen haben m√∂chten oder Anregungen oder Kommentare haben, k√∂nnen Sie sich gern direkt per E-Mail an die Datenschutzbeauftragte der Bundeszentrale f√ºr politische Bildung wenden: <a tabindex="102" title="" class="link_normal" href="mailto:diehl@bpb.de">diehl@bpb.de</a>.</div>';
