WOMT_aTexte['4_erg_text_1'][0]='Hinweis: Eine √§hnlich hohe √úbereinstimmung zwischen Ihren Antworten und den Antworten mehrerer Parteien bedeutet nicht zwangsl√§ufig eine inhaltliche N√§he der Parteien zueinander.<br/><br/>Die meisten der 38 Wahl-O-Mat-Thesen decken wichtige sachpolitische Themen zur Bundestagswahl ab. Auf diese haben auch Parteien geantwortet, die vom Verfassungsschutz als extremistisch eingestuft werden (<a class="pfeil_fett" href="http://www.verfassungsschutz.de" tabindex="39" title="www.verfassungsschutz.de (Dieser Link √∂ffnet sich in einem neuen Fenster.)" target="_blank" style="padding-left:0px;background-image: none !important;">www.verfassungsschutz.de</a>). Extremistische Einstellungen einzelner Parteien werden nur in wenigen Thesen erfasst. Vergleichen Sie daher unten die Antworten der Parteien auf alle Thesen. Bitte schauen Sie zur Einordnung der einzelnen Parteien auch unter <a tabindex="39" title="Wer steht zur Wahl? (Dieser Link √∂ffnet sich in einem neuen Fenster.)" class="pfeil_fett" href="http://www.wahl-o-mat.de/bundestagswahl2009/wszw.php" target="_blank">www.werstehtzurwahl.de</a>.';
